import React from 'react';

function Header() {
  return (
    <>
      <img
        src="https://notaboutthemiles.com/wp-content/uploads/2017/11/Grand-Canal-in-Venice.jpg"
        alt="Header Image"
        style={{ opacity: 0.5 }}
      />
    </>
  );
}

export default Header;
